import React from 'react';
import { Button } from '@material-ui/core';
import { Link as NextLink } from 'next/Link'

export const DesktopMenu = () => {
  return (
    <div>
      <Link href="/auth">
        <Button color="inherit">Login</Button>
      </Link>

      <Button color="inherit">Register</Button>
    </div>
  );
};
